import React, { useState } from 'react';
import { signup } from '../services/auth';
import {
  Box,
  Button,
  TextField,
  Typography,
  Alert,
  Paper,
  Avatar,
  Stack,
} from '@mui/material';
import PersonAddAltIcon from '@mui/icons-material/PersonAddAlt';
import { useNavigate } from 'react-router-dom';

const Signup: React.FC<{ onSignup: () => void }> = ({ onSignup }) => {
  const [form, setForm] = useState({
    firstName: '',
    lastName: '',
    username: '',
    email: '',
    dateOfBirth: '',
    password: '',
    confirmPassword: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const navigate = useNavigate();

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    if (form.password !== form.confirmPassword) {
      setError('Passwords do not match');
      return;
    }
    try {
      await signup(
        form.username,
        form.password,
        form.firstName,
        form.lastName,
        form.email,
        form.dateOfBirth
      );
      setSuccess('Signup successful! You can now log in.');
      onSignup();
    } catch (err: any) {
      setError(err.response?.data || 'Signup failed');
    }
  };

  return (
    <Box
      sx={{
        minHeight: '100vh',
        background: 'linear-gradient(135deg, #e0e7ff 0%, #f3f4f6 100%)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
      }}
    >
      <Paper elevation={6} sx={{ p: 4, borderRadius: 3, minWidth: 350, maxWidth: 400 }}>
        <Box display="flex" flexDirection="column" alignItems="center" mb={2}>
          <Avatar sx={{ bgcolor: '#1976d2', mb: 1 }}>
            <PersonAddAltIcon />
          </Avatar>
          <Typography variant="h5" fontWeight={600} color="primary" mb={1}>
            Create Your Account
          </Typography>
          <Typography variant="body2" color="text.secondary" mb={2}>
            Please fill in the information below to sign up.
          </Typography>
        </Box>
        <Box component="form" onSubmit={handleSubmit}>
          <Stack spacing={2}>
            <TextField
              label="First Name"
              name="firstName"
              fullWidth
              value={form.firstName}
              onChange={handleChange}
              autoComplete="given-name"
              required
            />
            <TextField
              label="Last Name"
              name="lastName"
              fullWidth
              value={form.lastName}
              onChange={handleChange}
              autoComplete="family-name"
              required
            />
            <TextField
              label="Username"
              name="username"
              fullWidth
              value={form.username}
              onChange={handleChange}
              autoComplete="username"
              required
            />
            <TextField
              label="Email"
              name="email"
              type="email"
              fullWidth
              value={form.email}
              onChange={handleChange}
              autoComplete="email"
              required
            />
            <TextField
              label="Date of Birth"
              name="dateOfBirth"
              type="date"
              fullWidth
              value={form.dateOfBirth}
              onChange={handleChange}
              InputLabelProps={{ shrink: true }}
              required
            />
            <TextField
              label="Password"
              name="password"
              type="password"
              fullWidth
              value={form.password}
              onChange={handleChange}
              autoComplete="new-password"
              required
            />
            <TextField
              label="Confirm Password"
              name="confirmPassword"
              type="password"
              fullWidth
              value={form.confirmPassword}
              onChange={handleChange}
              autoComplete="new-password"
              required
            />
            {error && <Alert severity="error">{error}</Alert>}
            {success && <Alert severity="success">{success}</Alert>}
            <Button
              type="submit"
              variant="contained"
              color="primary"
              fullWidth
              sx={{ fontWeight: 600, fontSize: '1rem' }}
            >
              Sign Up
            </Button>
            <Button
              variant="outlined"
              fullWidth
              sx={{ fontWeight: 600, fontSize: '1rem' }}
              onClick={() => navigate('/login')}
            >
              Back to Login
            </Button>
          </Stack>
        </Box>
      </Paper>
    </Box>
  );
};

export default Signup;
